import 'package:fdnt/business_logic/data_types/post.dart';
import 'package:flutter/cupertino.dart';
import 'package:flutter_html/flutter_html.dart';

class NewsListViewModel extends ChangeNotifier {
  List<NewsViewModel> posts = [];



  final String example =  """
    <img src="data:image/gif;base64,">
    """;

  final String example2 = """
<img src=\"data:image/png;base64,\">""";



  void fetchNews()  {
    final results = [
      Post("To jest kolokwium z algebry liniowej. Mona je rozwiza na przykad", example),
      Post("Ale fajny post!", example2),
      Post("Przykadowy zepsuty post", "niedziaajcy html")
    ];
    this.posts = results.map((post) => NewsViewModel(post)).toList();
  }
}

class NewsViewModel {
  final Post post;

  NewsViewModel(this.post);

  String get title => this.post.title;
  String get html => this.post.html;
}